(110, '30 Rock', 11215, 58326, '{"genres": ["Comedy"], "classification": "Scripted", "started": "Oct/11/2006", "airday": "Thursday", "ended": "", "tvrage_link": "http://tvrage.com/30_Rock", "seasons": null, "akas": [["A st\\u00fadi\\u00f3", [["country", "HU"]]], ["Rockefeller Plaza", [["country", "ES"]]]]}', '30Rock', '2012-01-10 19:24:32', '2012-05-19 04:00:07', '20:00', 'GMT-5 +DST', 1800, 'Final Season', 'NBC', 'US', 'Single Liz Lemon is living every comedy writer''s dream. She''s head writer on a demanding, live TV program in New York City whose life is jolted when a brash new network president (Alec Baldwin) interferes with her show and bullies Liz into convincing Tracy Jordan (Tracy Morgan), a wild and unpredictable movie star, to join the cast. Now Liz must manage the unmanageable so that the show -- and her dream -- can go on. ', 0, 0, 0),
