(116, 'American Dad!', 2594, 21935, '{"genres": ["Adult Cartoons", "Comedy"], "classification": "Animation", "started": "Feb/06/2005", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/American_Dad", "seasons": null, "akas": [["AD", [["attr", "Abbreviation"]]], ["Amerikai fater", [["country", "HU"]]], ["\\u0410\\u043c\\u0435\\u0440\\u0438\\u043a\\u0430\\u043d\\u0441\\u043a\\u0438\\u0439 \\u043f\\u0430\\u043f\\u043e\\u0447\\u043a\\u0430", [["country", "RU"]]], ["\\u05d0\\u05d1\\u05d0 \\u05d0\\u05de\\u05e8\\u05d9\\u05e7\\u05d0\\u05d9", [["country", "IL"]]], ["\\u7279\\u5de5\\u8001\\u7239", [["country", "CN"]]]]}', 'AmericanDad', '2012-01-10 19:24:32', '2012-07-27 04:00:09', '21:30', 'GMT-5 +DST', 1800, 'Returning Series', 'FOX', 'US', 'The animated story of Stan Smith, who works for the CIA and is constantly on the alert for terrorist activity. Stan will go to extremes to protect his beloved America from harm – as evidenced by the terror-alert color code on his fridge, and his frequent knee-jerk reaction of shooting holes in the toaster whenever the toast pops up.', 0, 0, 0),
(118, 'The Apprentice', 5580, 20528, '{"genres": ["Financial/Business", "Talent"], "classification": "Reality", "started": "Jan/08/2004", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/The_Apprentice", "seasons": null, "akas": [["The Apprentice Los Angeles", [["country", "US"], ["attr", "6th season title"]]], ["The Apprentice USA", [["country", "UK"], ["attr", "Alternate Title"]]], ["The Apprentice: LA", [["country", "US"], ["attr", "Alternate 6th season title"]]], ["The Celebrity Apprentice", [["country", "US"], ["attr", "7th season title"]]], ["The Celebrity Apprentice 2", [["country", "US"], ["attr", "8th season title"]]], ["The Celebrity Apprentice 3", [["country", "US"], ["attr", "9th season title"]]], ["The Celebrity Apprentice 4", [["country", "US"], ["attr", "11th season title"]]], ["The Celebrity Apprentice 5", [["attr", "12th season title"]]]]}', 'Apprentice', '2012-01-10 19:24:32', '2012-06-04 04:00:04', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'NBC', 'US', '', 0, 0, 0),
(129, 'Bones', 2870, 33332, '{"genres": [null, "Comedy", "Crime", "Drama"], "classification": "Scripted", "started": "Sep/13/2005", "airday": "Monday", "ended": "", "tvrage_link": "http://tvrage.com/Bones", "seasons": null, "akas": [["Bones - Die Knochenj\\u00e4gerin", [["country", "DE"]]], ["Brennan", [["country", "US"], ["attr", "Working Title"]]], ["Dr. Csont", [["country", "HU"]]], ["Kaulai", [["country", "LT"]]], ["Kondid", [["country", "EE"]]], ["Ko\\u015bci", [["country", "PL"]]], ["Ossos", [["country", "PT"]]], ["Sb\\u011bratel\\u00e9 kost\\u00ed", [["country", "CZ"]]], ["\\u041a\\u043e\\u0441\\u0442\\u0438", [["country", "BG"]]], ["\\u8bc6\\u9aa8\\u5bfb\\u8e2a", [["country", "CN"]]]]}', 'Bones', '2012-01-10 19:24:32', '2012-04-28 03:00:04', '20:00', 'GMT-5 +DST', 3600, 'Returning Series', 'FOX', 'US', 'Forensic anthropologist Dr. Temperence Brennan, who works at the Jeffersonian Institution and writes novels as a sideline, has an uncanny ability to read clues left behind in a victim''s bones. Consequently, law enforcement calls her in to assist with murder investigations when the remains are so badly decomposed, burned, or destroyed that the standard identification methods are useless. \r\n\r\nBrennan''s equally brilliant colleagues at the Jeffersonian''s Medico-Legal Lab include earthy and bawdy Angela Montenegro, who''s created a unique way to render an original crime scene in a three-dimensional computer image; Brennan''s assistant, Zack Addy, a young prodigy whose genius IQ actually gets in the way of his finishing the several doctorates he''s begun; "the bug guy", Dr. Jack Hodgins, who''s an expert on insects, spores and minerals, but conspiracy is his hobby; and Brennan''s boss, imposing lab director Dr. Daniel Goodman. Brennan often finds herself teamed with Special Agent Seely Booth, a former Army sniper who mistrusts science and scientists when it comes to solving crimes. Brennan and Booth clash both professionally and personally, but so far the chemistry between them has only played out in a fictionalized account in Brennan''s lastest mystery novel.', 0, 0, 0),
(131, 'The Boondocks', 5638, 26812, '{"genres": ["Adult Cartoons", "Comedy"], "classification": "Animation", "started": "Nov/06/2005", "ended": "", "tvrage_link": "http://tvrage.com/The_Boondocks", "seasons": null, "airday": "Sunday"}', 'Boondocks', '2012-01-10 19:24:32', '2012-03-14 04:00:10', '23:30', 'GMT-5 +DST', 1800, 'Returning Series', 'Adult Swim', 'US', '', 0, 0, 0),
(136, 'The Closer', 5685, 28972, '{"genres": ["Drama"], "classification": "Scripted", "started": "Jun/13/2005", "airday": "Monday", "ended": "Aug/13/2012", "tvrage_link": "http://tvrage.com/The_Closer_2005", "seasons": null, "akas": [["A f\\u0151n\\u00f6k", [["country", "HU"]]], ["Detektyv\\u0117 D\\u017eonson", [["country", "LT"]]]]}', 'Closer', '2012-01-10 19:24:32', '2012-08-15 04:00:05', '21:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'TNT', 'US', 'Deputy Police Chief Brenda Leigh Johnson is a police detective who transfers from Atlanta to Los Angeles to head up a special unit of the LAPD that handles sensitive, high-profile murder cases. Despite a tendency to step on people''s toes, Johnson manages to convert even her strongest adversaries with her unique ability to get to the truth.', 0, 0, 1),
(144, 'Criminal Minds', 3171, 33484, '{"genres": ["Action", "Adventure", "Crime", "Drama"], "classification": "Scripted", "started": "Sep/22/2005", "airday": "Wednesday", "ended": "", "tvrage_link": "http://tvrage.com/Criminal_Minds", "seasons": null, "akas": [["Criminal Minds - FBI-tutkijat", [["country", "FI"]]], ["Diavolika myala", [["country", "GR"], ["attr", "(transliterated ISO-LATIN-1 title)"]]], ["Esprits criminels", [["country", "FR"]]], ["Gl\\u00e6pahneig\\u00f0", [["country", "IS"]]], ["Gyilkos elm\\u00e9k", [["country", "HU"]]], ["Krimin\\u00e1lis elm\\u00e9k", [["country", "HU"], ["attr", "Alternate title"]]], ["Kurjuse kannul", [["country", "EE"]]], ["Mentes criminales", [["country", "ES"]]], ["Minti Criminale", [["country", "RO"]]], ["My\\u0161lenky zlo\\u010dince", [["country", "CZ"]]], ["Nusikalstami protai", [["country", "LT"]]], ["Quantico", [["country", "US"], ["attr", "working title"]]], ["Zlocinacki umovi", [["country", "HR"], ["attr", "Alternate title"]]], ["\\u041c\\u044b\\u0441\\u043b\\u0438\\u0442\\u044c \\u043a\\u0430\\u043a \\u043f\\u0440\\u0435\\u0441\\u0442\\u0443\\u043f\\u043d\\u0438\\u043a", [["country", "RU"]]], ["\\u72af\\u7f6a\\u5fc3\\u7406", [["country", "CN"]]], ["\\u7f6a\\u72af\\u89e3\\u78bc", [["country", "HK"]]]]}', 'CriminalMinds', '2012-01-10 19:24:32', '2012-03-14 04:00:10', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'CBS', 'US', 'The Behaviorial Analysis Unit is composed of an elite team of FBI profilers who analyze the country''s most twisted criminal minds and anticipate their next moves before they strike again.\r\n\r\nCriminal Minds stars Mandy Patinkin as Special Agent Jason Gideon, Thomas Gibson as Special Agent Aaron Hotchner, Lola Glaudini as Elle Greenaway, Shemar Moore as Special Agent Derek Morgan, Matthew Gray Gubler as Special Agent Dr. Spencer Reid, AJ Cook as Jennifer "JJ" Jareau, and Kirsten Vangsness as Penelope Garcia. ', 0, 0, 0),
(147, 'C.S.I.', 3183, 19, '{"genres": ["Action", "Crime", "Drama"], "classification": "Scripted", "started": "Oct/06/2000", "airday": "Wednesday", "ended": "", "tvrage_link": "http://tvrage.com/CSI", "seasons": null, "akas": [["A helysz\\u00ednel\\u00f5k", [["country", "HU"], ["attr", "1st Season title"]]], ["C.S.I.", [["country", "FI"], ["attr", "Alternate title"]]], ["C.S.I. - Den T\\u00e4tern auf der Spur", [["country", "DE"], ["attr", "New Title"]]], ["C.S.I. - Tatort Las Vegas", [["country", "DE"]]], ["C.S.I. \\u041c\\u0435\\u0441\\u0442\\u043e \\u043f\\u0440\\u0435\\u0441\\u0442\\u0443\\u043f\\u043b\\u0435\\u043d\\u0438\\u044f", [["country", "RU"]]], ["C.S.I.: Scena del crimine", [["country", "IT"]]], ["CSI", [["country", "US"], ["attr", "Shorthand Title"]]], ["CSI - Crime \\u015fi investiga\\u0163ii", [["country", "RO"]]], ["CSI kriminalistai", [["country", "LT"]]], ["CSI: A helysz\\u00ednel\\u00f5k", [["country", "HU"], ["attr", "Promotional title"]]], ["CSI: Crime Sob Investiga\\u00e7\\u00e3o", [["country", "PT"]]], ["CSI: Investiga\\u00e7\\u00e3o Criminal", [["country", "BR"], ["attr", "Dubbed version title"]]], ["CSI: Kagaku s\\u00f4sa han", [["country", "JP"], ["attr", "English translation"]]], ["CSI: Kriminalistid", [["country", "EE"]]], ["CSI: Kryminalne zagadki Las Vegas", [["country", "PL"], ["attr", "Alternate title"]]], ["CSI: Las Vegas", [["country", "US"], ["attr", "Syndication Title"]]], ["CSI: Weekends", [["country", "US"], ["attr", "Promotional Title"]]], ["CSI:\\u79d1\\u5b66\\u635c\\u67fb\\u73ed", [["country", "JP"]]], ["Ekipa za ocevid", [["country", "HR"], ["attr", "Alternate title"]]], ["Escena del crimen", [["country", "VE"]]], ["Helysz\\u00ednel\\u0151k", [["country", "HU"]]], ["Krimin\\u00e1lka Las Vegas", [["country", "CZ"]]], ["Kryminalne zagadki Las Vegas", [["country", "PL"]]], ["La Ciencia al Servicio de la Investigaci\\u00f3n", [["country", "MX"], ["attr", "Alternate title"]]], ["Les Experts", [["country", "CH"], ["attr", "Alternate title"]]], ["Les experts: Las Vegas", [["country", "FR"], ["attr", "Promotional title"]]], ["Na kraju zlocina", [["country", "SI"]]], ["Ston topo tou eglimatos", [["country", "GR"], ["attr", "(transliterated ISO-LATIN-1 title)"]]], ["\\u6848\\u5f71\\u8ffd\\u8e2a", [["country", "CN"]]]]}', 'CSI', '2012-01-10 19:24:32', '2012-03-14 04:00:12', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'CBS', 'US', 'CSI is an innovative, new type of crime drama because the characters use cutting-edge forensic tools to examine the evidence to solve the case. Rather than a ''whodunnit'' cop show (investigating witnesses/suspects), CSI explores the ''howdunnit''.', 0, 0, 0),
(148, 'C.S.I. Miami', 3184, 8460, '{"genres": ["Action", "Crime", "Drama"], "classification": "Scripted", "started": "Sep/23/2002", "airday": "Sunday", "ended": "Apr/08/2012", "tvrage_link": "http://tvrage.com/CSI_Miami", "seasons": null, "akas": [["CSI Majamis", [["country", "LT"]]], ["CSI:\\u30de\\u30a4\\u30a2\\u30df", [["country", "JP"]]], ["CSI\\u72af\\u7f6a\\u73fe\\u5834: \\u9081\\u963f\\u5bc6", [["country", "CN"]]], ["Kriminaletterforskning: Miami", [["country", "NO"]]], ["Krimin\\u00e1lka Miami", [["country", "CZ"]]], ["Kryminalne zagadki Miami", [["country", "PL"]]], ["Les Experts: Miami", [["country", "FR"]]], ["Miami helysz\\u00ednel\\u0151k", [["country", "HU"]]], ["Na kraju zlo\\u010dina: Miami", [["country", "SI"]]]]}', 'CSIMiami', '2012-01-10 19:24:32', '2012-05-14 03:00:09', '22:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'CBS', 'US', 'CSI: Crime Scene Investigation took television by storm in 2000 with its innovative and cutting-edge updating of a standard series concept – in this case, the cop show. Suddenly, instead of simply whodunit, solving crimes was a matter of howdunit, and with what size shoe, and whether anyone left behind traces of evidence that the blue ALS light could pick up.\r\n\r\nNow that gritty approach to crime known as forensic science makes its way from Las Vegas to the streets of Florida in CSI: Miami. A whole new team of crime scene investigators is on hand to probe the seamy underside of what some refer to as Cuba North and others call Georgia South. Consider it a tropical blend of people, culture, nightlife and, of course, the occasional killing or two. Just as you do in Vegas, come for the crime, stick around for the clues. And there''s always a clue.', 0, 0, 1),
(149, 'CSI: New York', 3185, 24125, '{"genres": ["Action", "Crime", "Drama", "Mystery", "Thriller"], "classification": "Scripted", "started": "Sep/22/2004", "airday": "Friday", "ended": "", "tvrage_link": "http://tvrage.com/CSI_NY", "seasons": null, "akas": [["C.S.I.: Nova Iorque", [["country", "PT"]]], ["C.S.I.: Nueva York", [["country", "ES"]]], ["CSI - Nea Yorki", [["country", "GR"]]], ["CSI Niujorkas", [["country", "LT"]]], ["CSI: New York", [["country", "US"]]], ["CSI: New York - Criminali\\u015ftii", [["country", "RO"]]], ["CSI: \\u041c\\u0435\\u0441\\u0442\\u043e \\u043f\\u0440\\u0435\\u0441\\u0442\\u0443\\u043f\\u043b\\u0435\\u043d\\u0438\\u044f \\u041d\\u044c\\u044e-\\u0419\\u043e\\u0440\\u043a", [["country", "RU"]]], ["CSI:\\u30cb\\u30e5\\u30fc\\u30e8\\u30fc\\u30af", [["country", "JP"]]], ["CSI\\u72af\\u7f6a\\u73fe\\u5834: \\u7d10\\u7d04", [["country", "CN"]]], ["Krimin\\u00e1lka New York", [["country", "CZ"]]], ["Kryminalne zagadki Nowego Jorku", [["country", "PL"]]], ["Les Experts: Manhattan", [["country", "FR"]]], ["Na kraju zlo\\u010dina: New York", [["country", "SI"]]], ["New York-i helysz\\u00ednel\\u0151k", [["country", "HU"]]]]}', 'CSINY', '2012-01-10 19:24:32', '2012-06-08 04:00:07', '20:00', 'GMT-5 +DST', 3600, 'Returning Series', 'CBS', 'US', 'The third edition of the "CSI" franchise sets up shop in the Big Apple, where taciturn Detective Mac Taylor and his partner, Detective Stella Bonasera, lead a crime-solving team. Like his counterparts in Las Vegas and Miami, Taylor knows that people may lie, but the evidence rarely does.', 0, 0, 0),
(150, 'Curb Your Enthusiasm', 3188, 3720, '{"genres": ["Comedy"], "classification": "Scripted", "started": "Oct/15/2000", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/Curb_Your_Enthusiasm", "seasons": null, "akas": [["Pohamuj entuzjazm", [["country", "PL"]]]]}', 'CurbYourEnthusiasm', '2012-01-10 19:24:32', '2012-03-14 04:00:13', '22:00', 'GMT-5 +DST', 1800, 'TBD/On The Bubble', 'HBO', 'US', 'Each half-hour episode of Curb Your Enthusiasm features verité-style footage of David (playing himself) at home, at work and around town, as he gets into predicaments with fictional and real-life personalities. With cast regulars Jeff Garlin (as manager Jeff Greene) and Cheryl Hines (as wife Cheryl) reprising their roles, the series features appearances by guest celebrities playing themselves or character roles.\r\n\r\n The series blurs the lines between reality and fiction, as David (playing himself) and a cast of real and fictional characters are followed around Los Angeles by a ubiquitous camera that chronicles the private, often banal world of a (relatively) public man.\r\n\r\nHaving evolved from the 1999 HBO special Larry David: Curb Your Enthusiasm, this series proves how seemingly trivial details of one''s day-to-day life--a trip to the movies, a phone call, a visit from some trick-or-treaters--can precipitate a "Murphy''s Law" chain of misfortune to hilarious effect. Like George Costanza in Seinfeld, the protagonist of Curb Your Enthusiasm has a knack for getting himself into uncomfortable situations that end up alienating him from peers and acquaintances.\r\n\r\nTo keep the narrative fresh and spontaneous, Curb Your Enthusiasm is shot without a script; the cast is given scene outlines and often improvise lines as they go. The result is an unpredictable format that''s unlike anything else on TV.', 0, 0, 0),
(153, 'Desperate Housewives', 3294, 24641, '{"genres": ["Comedy", "Drama"], "classification": "Scripted", "started": "Oct/03/2004", "airday": "Sunday", "ended": "May/13/2012", "tvrage_link": "http://tvrage.com/Desperate_Housewives", "seasons": null, "akas": [["A\\u00f0\\u00ferengdar eiginkonur", [["country", "IS"]]], ["Frustrerte fruer", [["country", "NO"]]], ["Gotowe na wszystko", [["country", "PL"]]], ["Housewives", [["attr", "USA Short Title"]]], ["Ku\\u0107anice", [["country", "HR"]]], ["Meeleheitel koduperenaised", [["country", "EE"]]], ["Mujeres Desesperadas", [["country", "ES"]]], ["Nh\\u1eefng b\\u00e0 n\\u1ed9i tr\\u1ee3 ki\\u1ec3u M\\u1ef9", [["country", "VN"]]], ["Nusivylusios nam\\u0173 \\u0161eiminink\\u0117s", [["country", "LT"]]], ["O\\u010dajne ku\\u0107anice", [["country", "BS"]]], ["Razo\\u010darane gospodinje", [["country", "SI"]]], ["Sz\\u00fcletett feles\\u00e9gek", [["country", "HU"]]], ["T\\u00e4ydelliset naiset", [["country", "FI"]]], ["Umutsuz Ev Kad\\u0131nlar\\u0131", [["country", "TR"]]], ["Zoufal\\u00e9 man\\u017eelky", [["country", "CZ"]]], ["Z\\u00fafal\\u00e9 man\\u017eelky", [["country", "SK"]]], ["\\u039d\\u03bf\\u03b9\\u03ba\\u03bf\\u03ba\\u03c5\\u03c1\\u03ad\\u03c2 \\u03a3\\u03b5 \\u0391\\u03c0\\u03cc\\u03b3\\u03bd\\u03c9\\u03c3\\u03b7", [["country", "GR"]]], ["\\u041e\\u0442\\u0447\\u0430\\u044f\\u043d\\u0438 \\u0441\\u044a\\u043f\\u0440\\u0443\\u0433\\u0438", [["country", "BG"]]], ["\\u041e\\u0442\\u0447\\u0430\\u044f\\u043d\\u043d\\u044b\\u0435 \\u0434\\u043e\\u043c\\u043e\\u0445\\u043e\\u0437\\u044f\\u0439\\u043a\\u0438", [["country", "RU"]]], ["\\u05e2\\u05e7\\u05e8\\u05d5\\u05ea \\u05d1\\u05d9\\u05ea \\u05e0\\u05d5\\u05d0\\u05e9\\u05d5\\u05ea", [["country", "IL"]]], ["\\u06a9\\u062f\\u0628\\u0627\\u0646\\u0648\\u0647\\u0627\\u06cc \\u062f\\u0631\\u0645\\u0627\\u0646\\u062f\\u0647", [["country", "IR"]]], ["\\u10e1\\u10d0\\u10e1\\u10dd\\u10ec\\u10d0\\u10e0\\u10d9\\u10d5\\u10d4\\u10d7\\u10d8\\u10da\\u10d8 \\u10d3\\u10d8\\u10d0\\u10e1\\u10d0\\u10ee\\u10da\\u10d8\\u10e1\\u10d4\\u10d1\\u10d8", [["country", "GE"]]], ["\\u30c7\\u30b9\\u30d1\\u30ec\\u30fc\\u30c8\\u306a\\u59bb\\u305f\\u3061", [["country", "JP"]]], ["\\u6b32\\u4e71\\u7edd\\u60c5\\u59bb", [["country", "CN"]]]]}', 'DesperateHousewives', '2012-01-10 19:24:32', '2012-07-14 04:00:12', '21:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'ABC', 'US', 'The series began with Mary Alice Young leaving her perfect house in the loveliest of suburbs -- and ending it all. Now she takes us into the lives of her family, friends and neighbors, commenting from her elevated P.O.V.\r\n\r\nHer circle of girlfriends on Wisteria Lane include Susan Mayer, the divorcee and single mom who will go to extraordinary lengths for love; Lynette Scavo, who recently went from being a stay-at-home mother of four back to her fast track career in advertising; Bree Van De Kamp, Martha Stewart on steroids, whose recent widowhood has completely reeked havoc on her perfect life; and Gabrielle Solis, the ex-model with everything she’s ever wanted – a rich husband, a big house, and now a baby to go with it all… the problem is she’s not sure who the father is; and serial divorcee Edie Britt, the free spirited real estate maven whose love life has everyone buzzing. Enter newcomer Betty Applewhite and her handsome teenage son, Matthew, who mysteriously moved into a house they’d never seen in the middle of the night.\r\n\r\nThen there are the men: Mike Delfino, a supposedly widowed plumber who has won Susan’s heart; Lynette’s adorable husband, Tom, who volunteered to be “Mr. Mom” so his wife can go back to work; Gabrielle’s better half, Carlos, who is currently in jail and recently learned of his wife’s infidelities with John, the gardener; and Mary Alice’s widowed husband, Paul, who is on the run from the demons in his past.\r\n\r\nFrom her unique vantage point, Mary Alice sees more now than she ever did alive, and she’s planning to share all the delicious secrets that hide behind every neighbor’s closed door in this seemingly perfect American suburb.', 0, 0, 1),
