(157, 'Entourage', 3449, 27346, '{"genres": ["Comedy", "Drama"], "classification": "Scripted", "started": "Jul/18/2004", "airday": "Sunday", "ended": "Sep/11/2011", "tvrage_link": "http://tvrage.com/Entourage", "seasons": null, "akas": [["Anturaj", [["country", "RO"]]], ["Ekipa", [["country", "PL"]]], ["Vincent\\u016fv sv\\u011bt", [["country", "CZ"]]], ["\\u05d4\\u05e4\\u05de\\u05dc\\u05d9\\u05d4", [["country", "IL"]]]]}', 'Entourage', '2012-01-10 19:24:32', '2012-03-14 04:00:14', '22:30', 'GMT-5 +DST', 1800, 'Canceled/Ended', 'HBO', 'US', 'Vince Chase is a sexy young actor whose career is on the rise. To share the fun of his ride to the top of Hollywood and keep him grounded, Vince looks to Eric, Drama and Turtle, his childhood buddies from Queens. Together, they''ll navigate the highs and lows of Hollywood''s fast lane, where the stakes are higher, and the money and temptations greater, than ever before. But that certainly will not stop them from having fun the whole way through.\r\n\r\nVince, an actor on the verge of stardom.  \r\nEric, Vince''s closest confidant who''s learning the rules of the business as he tries to help Vince make the right choices and keep his goals aimed high.  \r\nVince''s half-brother Johnny Drama, whose own acting aspirations have been eclipsed by Vince''s success, but that doesn''t stop Johnny from constantly looking for work and going to auditions. \r\nTurtle, the least experienced of the group who is always up for a good time.  \r\nAri, Vince''s aggressive, high-powered agent, who clashes with Eric over his client''s decisions.', 0, 0, 1),
(163, 'Family Guy', 3506, 348, '{"genres": ["Adult Cartoons", "Comedy"], "classification": "Animation", "started": "Jan/31/1999", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/Family_Guy", "seasons": null, "akas": [["FG", [["attr", "Abbreviation"]]], ["G\\u0142owa rodziny", [["country", "PL"]]], ["\\u0160eimos bi\\u010das", [["country", "LT"]]], ["\\u0413\\u0440\\u0438\\u0444\\u0444\\u0438\\u043d\\u044b", [["country", "RU"]]], ["\\u05d0\\u05d9\\u05e9 \\u05de\\u05e9\\u05e4\\u05d7\\u05d4", [["country", "IL"]]]]}', 'FamilyGuy', '2012-01-10 19:24:32', '2012-03-14 04:00:14', '21:00', 'GMT-5 +DST', 1800, 'Returning Series', 'FOX', 'US', 'Sick, twisted, politcially incorrect and freakin'' sweet, the animated series features the adventures of the Griffin family. Peter and Lois have three kids - the youngest is a brilliant, sadistic baby bent on killing his mother and destroying the world. Their talking dog Brian keeps baby Stewie in check while sipping martinis and sorting through his own life issues.\r\n\r\nAfter being cancelled in 2002, an outstanding performance in DVD sales proved its cult value. As a result, the series was added back to the FOX Summer 2005 lineup. Family Guy returned to the small screen with new episodes on Sunday, May 1st, 2005.', 0, 0, 0),
(171, 'Greys Anatomy', 3741, 24440, '{"genres": ["Drama", "Medical"], "classification": "Scripted", "started": "Mar/27/2005", "airday": "Thursday", "ended": "", "tvrage_link": "http://tvrage.com/Greys_Anatomy", "seasons": null, "akas": [["A Grace klinika", [["country", "HU"]]], ["Anatom\\u00eda de Grey", [["country", "ES"]]], ["Anatomia lui Grey", [["country", "RO"]]], ["Chirurdzy", [["country", "PL"]]], ["Chirurgov\\u00e9", [["country", "CZ"]]], ["Complications", [["country", "US"], ["attr", "Working Title"]]], ["Grei anatomija", [["country", "LT"]]], ["Grey", [["country", "MX"]]], ["Grey''s Anatomy - Die jungen \\u00c4rzte", [["country", "DE"]]], ["Grey''s Anatomy : \\u00e0 c\\u0153ur ouvert", [["country", "FR"]]], ["Greyn anatomia", [["country", "FI"]]], ["Greys hvide verden", [["country", "DK"]]], ["Klinika Grace", [["country", "SK"]]], ["Koi no kaibougaku", [["country", "JP"]]], ["Mathimata anatomias", [["country", "GR"]]], ["Procedure", [["country", "US"], ["attr", "Working Title"]]], ["Surgeons", [["country", "US"], ["attr", "Working Title"]]], ["Talenti v belem", [["country", "SI"]]], ["Under the Knife", [["country", "US"], ["attr", "Working Title"]]], ["Uvod u anatomiju", [["country", "HR"]]], ["\\u0410\\u043d\\u0430\\u0442\\u043e\\u043c\\u0438\\u044f \\u0441\\u0442\\u0440\\u0430\\u0441\\u0442\\u0438", [["country", "RU"]]], ["\\u05d4\\u05d0\\u05e0\\u05d8\\u05d5\\u05de\\u05d9\\u05d4 \\u05e9\\u05dc \\u05d2\\u05e8\\u05d9\\u05d9", [["country", "IL"]]], ["\\u5b9e\\u4e60\\u533b\\u751f\\u683c\\u857e", [["country", "CN"]]]]}', 'GreysAnatomy', '2012-01-10 19:24:32', '2012-03-14 04:00:14', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'ABC', 'US', 'Meet Meredith Grey. She''s a woman trying to lead a real life while doing a job that makes having a real life impossible.\r\n\r\nMeredith is a first year surgical intern at Seattle Grace Hospital, the toughest surgical residency program west of Harvard. She and fellow first-year interns Cristina Yang, Izzie Stevens, George O''Malley and Alex Karev were students yesterday. Today they''re doctors and, in a world where on the job training can be a matter of life and death, they''re all juggling the ups and downs of their own personal lives.\r\n\r\nThe five interns struggle to form friendships in this most stressful and competitive atmosphere. Meredith''s medical ambition is overshadowed by a troubling secret: Her mother, a noted pioneering surgeon, is struggling with a tragic and devastating illness. Cristina is highly competitive and driven, but lacks tact when it comes to bedside manner. Isobel "Izzie" Stevens is the small-town girl who grew up dirt poor and, in spite of paying for her medical career by modeling. Sometimes she cares a little too deeply about her patients. George O''Malley is the warm but insecure boy next door who always manages to do or say the wrong thing at the wrong time. In spite of his attraction to women, he''s treated as "just one of the girls." And Alex Karev, the intern the other interns love to have, masks his working class roots with arrogance and ambition.\r\n\r\nThe interns are guided by an established team of doctors who are determined to shape them into skilled surgeons or break them: Miranda Bailey, a senior resident responsible for training them, is so tough that she''s nicknamed "The Nazi." Derek Shepherd is the flirtatious but very capable surgeon who shares a forbidden but undeniable sexual attraction with Meredith. Preston Burke''s arrogance is second only to his skill with a scalpel. Overseeing them all is Dr. Richard Webber, Seattle Grace''s paternal, but no-nonsense chief of surgery.\r\n\r\nGrey''s Anatomy focuses on young people struggling to be doctors and doctors struggling to stay human. It''s the drama and intensity of medical training mixed with the funny, sexy, painful lives of interns who are about to discover that neither medicine nor relationships can be defined in black and white. Real life only comes in shades of grey.', 0, 0, 0),
(178, 'House', 3908, 22374, '{"genres": ["Drama", "Medical", "Mystery"], "classification": "Scripted", "started": "Nov/16/2004", "airday": "Monday", "ended": "May/21/2012", "tvrage_link": "http://tvrage.com/House", "seasons": null, "akas": [["Daktaras Hausas", [["country", "LT"]]], ["Doctor House", [["country", "RO"]]], ["Doktor House", [["country", "HU"]]], ["Dr House", [["country", "PL"]]], ["Dr. House", [["country", "DE"]]], ["House, M.D.", [["country", "US"], ["attr", "season 1"]]], ["\\u0414\\u043e\\u043a\\u0442\\u043e\\u0440 \\u0425\\u0430\\u0443\\u0441", [["country", "BG"]]], ["\\u05d4\\u05d0\\u05d5\\u05e1", [["country", "IL"]]]]}', 'House', '2012-01-10 19:24:32', '2012-05-22 04:00:14', '21:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'FOX', 'US', 'House is a new take on mystery, where the villain is a medical malady and the hero is an irreverent, controversial doctor who trusts no one, least of all his patients.\r\n\r\nDr. Gregory House is devoid of bedside manner and wouldn''t even talk to his patients if he could get away with it. Dealing with his own constant physical pain, he uses a cane that seems to punctuate his acerbic, brutally honest demeanor. While his behavior can border on antisocial, House is a maverick physician whose unconventional thinking and flawless instincts have afforded him a great deal of respect. An infectious disease specialist, he''s a brilliant diagnostician who loves the challenges of the medical puzzles he must solve in order to save lives.', 0, 0, 1),
