(199, 'Law & Order: SVU', 4204, 334, '{"genres": ["Action", "Crime", "Drama"], "classification": "Scripted", "started": "Sep/20/1999", "airday": "Wednesday", "ended": "", "tvrage_link": "http://tvrage.com/Law_And_Order_SVU", "seasons": null, "akas": [["Kova laki: Erikoisyksikk\\u00f6", [["country", "FI"]]], ["K\\u00fcl\\u00f6nleges \\u00fcgyoszt\\u00e1ly", [["country", "HU"]]], ["La ley y el orden: Unidad de v\\u00edctimas especiales", [["country", "AR"]]], ["La loi & l''ordre - Crimes sexuels", [["country", "CA"], ["attr", "French title"]]], ["Law & Order: New York - Special Victims", [["country", "DE"]]], ["Law & Order: Sei henzai s\\u00f4sa han", [["country", "JP"], ["attr", "alternative transliteration"]]], ["Law & Order: SVU", [["country", "US"], ["attr", "promotional abbreviation"]]], ["Ley y orden: Unidad de v\\u00edctimas especiales", [["country", "ES"]]], ["New York, unit\\u00e9 sp\\u00e9ciale", [["country", "FR"]]], ["Nomos kai taxi - Eidiki omada", [["country", "GR"]]], ["Special Victims Unit", [["country", "UK"], ["attr", "informal short title"]]], ["Zakon i red: Odjel za zrtve", [["country", "HR"]]]]}', 'LawandOrderSVU', '2012-01-10 19:24:32', '2012-05-27 04:00:28', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'NBC', 'US', 'The drama follows Det. Elliot Stabler, a seasoned veteran of the unit who has seen it all, and his partner, Olivia Benson, whose difficult past is the reason she joined the unit.\r\n\r\nOverseeing the team is Capt. Donald Cragen. Cragen’s tough but supportive approach to the team’s complex cases guides the squad through the challenges they face every day. Also featured is Det. John Munch, a transfer from Baltimore’s homicide unit, who brings his acerbic wit, conspiracy theories and street-honed investigative skills. Munch is partnered with Det. Odafin Tutuola, whose unique sense of humor and investigative experience make him a formidable match for Munch.\r\n\r\nAssistant District Attorney Alexandra Cabot, and her successor, ADA Casey Novak add a legal component to the series through their efforts to bring closure to the intense investigations. Also aiding the detectives is forensic psychiatrist Dr. George Huang, whose insight into the minds of the accused often provides significant clues that lead to the resolution of a case, and M.E. Melinda Warner, who helps the detectives get the evidence they need from the bodies they find.', 0, 0, 0),
(215, 'MythBusters', 4605, 22839, '{"genres": ["Discovery/Science", "Educational"], "classification": "Documentary", "started": "Jan/23/2003", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/MythBusters", "seasons": null, "akas": [["Mit\\u0173 griov\\u0117jai", [["country", "LT"]]], ["Pogromcy mit\\u00f3w", [["country", "PL"]]]]}', 'MythBusters', '2012-01-10 19:24:32', '2012-04-16 03:00:06', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'Discovery Channel', 'US', 'Did a Medieval Chinese astrologer make it into space by strapping rockets to his chair and setting them off? Just how hard IS it to find a needle in a haystack? Can you in fact go insane by having water drip on your forehead?\r\n\r\nThese are just a few of the myths, urban legends, and improbable sayings that the Mythbusters try to figure out. Comprised of special effects experts Adam Savage and Jamie Heineman - as well as their mottley crew of Mythbuilders, Mythterns, and resident ''crash test dummy'' Buster - they don''t just tell the myths, they put them to the test to see which ones are possible, and which ones are just plain bunk.', 0, 0, 0),
(216, 'NCIS', 4628, 16772, '{"genres": ["Action", "Crime", "Drama", "Military/War"], "classification": "Scripted", "started": "Sep/23/2003", "airday": "Tuesday", "ended": "", "tvrage_link": "http://tvrage.com/NCIS", "seasons": null, "akas": [["Agenci NCIS", [["country", "PL"]]], ["Anchet\\u0103 militar\\u0103", [["country", "RO"]]], ["N.C.I.S. - Unit\\u00e0 anticrimine", [["country", "IT"], ["attr", "Alternate title"]]], ["N.C.I.S.: Enqu\\u00eates sp\\u00e9ciales", [["country", "FR"]]], ["Naval CIS", [["country", "US"], ["attr", "Working Title"]]], ["Naval Criminal Investigative Service", [["country", "US"]]], ["Navy - investigaci\\u00f3n criminal", [["country", "ES"]]], ["Navy CIS", [["country", "DE"]]], ["Navy: NCIS", [["country", "US"]]], ["NCIS", [["country", "GR"], ["attr", "Alternate title"]]], ["NCIS - N\\u00e1mo\\u0159n\\u00ed vy\\u0161et\\u0159ovac\\u00ed slu\\u017eba", [["country", "CZ"]]], ["NCIS - N\\u00e1morn\\u00fd vy\\u0161etrovac\\u00ed \\u00farad", [["country", "SK"]]], ["NCIS - Naval Criminal Investigative Service", [["country", "NL"]]], ["NCIS - Tenger\\u00e9szeti helysz\\u00ednel\\u0151k", [["country", "HU"], ["attr", "Alternate title"]]], ["NCIS Rikostutkijat", [["country", "FI"]]], ["NCIS: Kriminalistid", [["country", "EE"], ["attr", "Alternate title"]]], ["NCIS: Naval Criminal Investigative Service", [["country", "US"], ["attr", "Original full title"]]], ["Omada NCIS", [["country", "GR"], ["attr", "Alternate title"]]], ["Preiskovalci na delu: NCIS", [["country", "SI"], ["attr", "Alternate title"]]], ["Specialioji j\\u016br\\u0173 policijos tarnyba", [["country", "LT"]]], ["\\u041c\\u043e\\u0440\\u0441\\u043a\\u0430\\u044f \\u043f\\u043e\\u043b\\u0438\\u0446\\u0438\\u044f: \\u0421\\u043f\\u0435\\u0446\\u043e\\u0442\\u0434\\u0435\\u043b", [["country", "RU"], ["attr", "Alternate title"]]]]}', 'NCIS', '2012-01-10 19:24:32', '2012-03-14 04:00:16', '20:00', 'GMT-5 +DST', 3600, 'Returning Series', 'CBS', 'US', 'Leading this team that operates outside of the military chain of command is NCIS Special Agent Leroy Jethro Gibbs, a skilled investigator and interrogator who is smart, tough and willing to bend the rules to get the job done.\r\n\r\nWorking under Gibbs is Agent Anthony Dinozzo, a former homicide detective who joined NCIS just a few years ago, but who has instincts that can come only from working on the streets.\r\n\r\nJoining them is Agent Abby Sciuto, a gifted forensic scientist whose dark wit matches her goth-style hair and clothes, and Dr. Donald "Ducky" Mallard, a medical examiner.\r\n\r\nFrom murder and espionage to terrorism and stolen submarines, these special agents traverse the globe to investigate all crimes with Navy or Marine Corps ties.', 0, 0, 0),
(224, 'The Office (US)', 6061, 22343, '{"genres": ["Comedy"], "classification": "Scripted", "started": "Mar/24/2005", "airday": "Thursday", "ended": "", "tvrage_link": "http://tvrage.com/The_Office", "seasons": null, "akas": [["Biuras", [["country", "LT"]]], ["Biuro", [["country", "PL"]]], ["Das B\\u00fcro", [["country", "DE"]]], ["The Office: An American Workplace", [["country", "US"], ["attr", "Original Full Title"]]], ["\\u041e\\u0444\\u0438\\u0441", [["country", "RU"]]]]}', 'Office_US', '2012-01-10 19:24:32', '2012-09-05 04:00:16', '21:00', 'GMT-5 +DST', 1800, 'Final Season', 'NBC', 'US', 'Based on the popular British series of the same name, this faster-paced American version follows the daily interactions of a group of idiosyncratic office employees via a documentary film crew''s cameras.\r\n\r\nRegional manager Michael thinks he''s the coolest, funniest, best boss ever - which, of course, makes him the uncoolest, most obnoxious and annoying boss as far as his staff is concerned. His co-worker Jim lusts after engaged receptionist Pam when he''s not sabotaging his cube-mate, the know-it-all Dwight.\r\nRyan Howard is a young, smart, self-possessed temp, who quickly figures out the real office politics despite Michael''s attempts to instill the official point-of-view.', 0, 0, 0),
(225, 'One Tree Hill', 4724, 16942, '{"genres": ["Drama"], "classification": "Scripted", "started": "Sep/23/2003", "airday": "Wednesday", "ended": "", "tvrage_link": "http://tvrage.com/One_Tree_Hill", "seasons": null, "akas": [["Hermanos Rebeldes", [["country", "MX"]]], ["Lances da Vida", [["country", "BR"]]], ["Les Fr\\u00e8res Scott", [["country", "FR"]]], ["Migrash Beyti", [["country", "IL"]]], ["Pogoda na mi\\u0142o\\u015b\\u0107", [["country", "PL"]]], ["Tunteet Peliss\\u00e4", [["country", "FI"]]], ["Tuti Gimi", [["country", "HU"]]], ["\\u03a6\\u03af\\u03bb\\u03bf\\u03b9 \\u03b3\\u03b9\\u03b1 \\u03c0\\u03ac\\u03bd\\u03c4\\u03b1", [["country", "GR"]]], ["\\u0422\\u0440\\u0438\\u0439 \\u0425\\u0438\\u043b", [["country", "BG"]]]]}', 'OneTreeHill', '2012-01-10 19:24:32', '2012-04-09 03:00:11', '20:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'The CW', 'US', 'Aside from a love for hoops, it would seem that Lucas and Nathan are two young men with little in common, but they are bound by the dark secret that they share the same father.\r\nArrogant and assured, Nathan is the star of the high school basketball team and hails from a wealthy family. Quiet and driven, Lucas is the only child of a single working mom. He is also a legendary playground basketball player.\r\n\r\nAfter growing up on opposite sides of the tracks in the same small town of Tree Hill, North Carolina, the two boys'' lives suddenly collide when a twist of fate puts Lucas on Nathan''s high school basketball team and the half-brothers compete, not only for control of the court, but also for the heart of Nathan''s beautiful girlfriend Peyton Sawyer.  \r\n\r\nWhile the teenagers struggle to find their places in the world, the adults in Tree Hill are dealing with the residue of decisions they made years ago. Nathan''s father Dan and Lucas'' mother Karen were high school sweethearts. When Karen became pregnant during their senior year, she was devastated by Dan''s decision to put his own life and career first. He went off to college on a basketball scholarship, leaving Karen behind to raise their son Lucas alone. When Dan''s dream of a basketball career didn''t work out, he returned to town with the wife he met in college and his new son, Nathan. Now a wealthy businessman and one of the biggest fish in the small pond of Tree Hill, Dan lives his basketball dreams through Nathan. \r\n\r\nLucas and Nathan''s new rivalry on and off the court has even brought back old emotions for the grizzled basketball coach, Whitey Durham. Whitey coached Nathan''s father, Dan, when he was the school''s star player, and now he is coaching both of Dan''s sons. He knows he is partly responsible for Dan''s decision to not give up his scholarship when Karen became pregnant, and he has to juggle conflicting responsibilities and loyalties toward the two boys.\r\n\r\nYears in the making, a deep and bitter conflict slowly unfolds as the two boys struggle to come to terms with who they really are and a father who has chosen to live vicariously through one son, while ignoring the existence of the other. ', 0, 0, 1),
(233, 'Real Time with Bill Maher', 4950, 17222, '{"genres": ["Comedy", "Current Events", "Debate", "Interview", "Politics"], "classification": "Talk Shows", "started": "Feb/21/2003", "ended": "", "tvrage_link": "http://tvrage.com/Real_Time_With_Bill_Maher", "seasons": null, "airday": "Friday"}', 'RealTimewithBillMaher', '2012-01-10 19:24:32', '2012-03-14 04:00:16', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'HBO', 'US', 'Each week Bill Maher surrounds himself with a panel of guests which include politicians, actors, comedians, musicians and the like to discuss what''s going on in the world.', 0, 0, 0),
(238, 'Robot Chicken', 5027, 33630, '{"genres": ["Stop-Motion", "Comedy"], "classification": "Animation", "started": "Feb/20/2005", "ended": "", "tvrage_link": "http://tvrage.com/Robot_Chicken", "seasons": null, "airday": "Sunday"}', 'RobotChicken', '2012-01-10 19:24:32', '2012-09-07 04:00:20', '23:55', 'GMT-5 +DST', 900, 'Returning Series', 'Adult Swim', 'US', 'Robot Chicken is original in the ways that there hasnt been any like it since Action League NOW! The great fact is the episodes are so incredibly random, yet they still happen to pull through and manage to be completely hilarious, without losing the viewers attention because of the entire random factor...\r\nSo read the rules and have fun posting... about the sheer random-ness that is Robot Chicken!\r\nVideos', 0, 0, 0),
(242, 'Saturday Night Live', 5098, 365, '{"genres": ["Comedy", "Sketch/Improv"], "classification": "Variety", "started": "Oct/11/1975", "airday": "Saturday", "ended": "", "tvrage_link": "http://tvrage.com/Saturday_Night_Live", "seasons": null, "akas": [["NBC''s Saturday Night", [["country", "US"], ["attr", "Original title 1975-1977"]]], ["SNL", [["country", "US"], ["attr", "Short Title"]]], ["SNL 25", [["country", "US"], ["attr", "1999-2000"]]]]}', 'SaturdayNightLive', '2012-01-10 19:24:32', '2012-03-14 04:00:17', '23:30', 'GMT-5 +DST', 5400, 'Returning Series', 'NBC', 'US', 'Saturday Night Live is a sketch comedy show that has run since the fall of 1975. \r\n\r\nSNL is still unique amongst other sketch shows because of the fact that it has always been live.', 0, 0, 0),
(249, 'The Simpsons', 6190, 146, '{"genres": ["Adult Cartoons", "Comedy"], "classification": "Animation", "started": "Dec/17/1989", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/The_Simpsons", "seasons": null, "akas": [["Die Simpsons", [["country", "DE"]]], ["Simpsonai", [["country", "LT"]]], ["Simpsonit", [["country", "FI"]]], ["Simpsonowie", [["country", "PL"]]]]}', 'Simpsons', '2012-01-10 19:24:32', '2012-03-14 04:00:17', '20:00', 'GMT-5 +DST', 1800, 'Returning Series', 'FOX', 'US', 'The FOX network''s most successful series to date was a spin-off from The Tracey Ullman Show. Originally appearing on that series as a 1 minute filler, the executive producers of that series, James L. Brooks & Sam Simon decided that these characters could support a half hour series. So they did it and started the longest running animated series in primetime network television.', 0, 0, 0),
