(263, 'Supernatural', 5410, 30144, '{"genres": ["Action", "Adventure", "Drama", "Horror/Supernatural", "Sci-Fi"], "classification": "Scripted", "started": "Sep/13/2005", "airday": "Friday", "ended": "", "tvrage_link": "http://tvrage.com/Supernatural", "seasons": null, "akas": [["Antgamtiska", [["country", "LT"]]], ["I\\u0161rinktieji", [["country", "LT"]]], ["Lovci duch\\u016f", [["country", "CZ"]]], ["Lovci na natprirodno", [["country", "HR"]]], ["Nie z tego \\u015bwiata", [["country", "PL"]]], ["Oda\\u00e1t", [["country", "HU"]]], ["Sobrenatural", [["country", "BR"]]], ["\\u0421\\u0432\\u0435\\u0440\\u0445\\u044a\\u0435\\u0441\\u0442\\u0435\\u0441\\u0442\\u0432\\u0435\\u043d\\u043d\\u043e\\u0435", [["country", "RU"]]], ["\\u72d9\\u9b54\\u4eba, \\u8d85\\u81ea\\u7136\\u6a94\\u6848", [["country", "HK"]]]]}', 'Supernatural', '2012-01-10 19:24:32', '2012-03-14 04:00:18', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'The CW', 'US', 'Two brothers travel the country looking for their missing father and battling evil spirits along the way. \r\n\r\nSam Winchester is a college student bound for law school, determined to escape his family''s past - unlike his older brother, Dean. Ever since they were little their father has been consumed with an obsession to find the evil forces that murdered his beloved wife, and recruited his two young sons to help them. They have grown up as hunters of the supernatural. Sam escaped this way of life after high school, and now has a happy life with his girlfriend, Jessica, and a promising future career. Dean, however, stayed behind with his father to join him in his "hunting". \r\n\r\nAfter Dean arrives for Sam''s help when their father goes missing, Sam must join his brother to find him. His one weekend trip to search for the missing John Winchester becomes an ongoing quest after a horrible tragedy ruins any thought of a happy life for Sam. \r\n\r\nThe two brothers, bound by tragedy and blood to their mission, travel across the country encountering terrifying and dangerous forces most believe to be nothing but superstition and folklore, such as the Lady in White, the Indian beast known as the Wendigo, Phantom Travelers who cause plane crashes, Bloody Mary, and many more.', 0, 0, 0),
(265, 'Survivor', 5418, 4742, '{"genres": ["Adventure", "Drama", "Family", "Travel"], "classification": "Reality", "started": "May/31/2000", "airday": "Wednesday", "ended": "", "tvrage_link": "http://tvrage.com/Survivor", "seasons": null, "akas": [["Survivor 20: Heroes vs. Villains", [["country", "US"], ["attr", "20th season title"]]], ["Survivor: Africa", [["country", "US"], ["attr", "3rd season title"]]], ["Survivor: All-Stars", [["country", "US"], ["attr", "8th season title"]]], ["Survivor: Borneo", [["country", "US"], ["attr", "1st season title"]]], ["Survivor: China", [["country", "US"], ["attr", "15th season title"]]], ["Survivor: Cook Islands", [["country", "US"], ["attr", "13th season title"]]], ["Survivor: Fiji", [["country", "US"], ["attr", "14th season title"]]], ["Survivor: Gabon - Earth''s Last Eden", [["country", "US"], ["attr", "17th season title"]]], ["Survivor: Guatemala - The Mayan Empire", [["country", "US"], ["attr", "11th season title"]]], ["Survivor: Marquesas", [["country", "US"], ["attr", "4th season title"]]], ["Survivor: Micronesia - Fans vs Favorites", [["country", "US"], ["attr", "16th season title"]]], ["Survivor: Nicaragua", [["country", "US"], ["attr", "21st season title"]]], ["Survivor: One World", [["country", "US"], ["attr", "24th season title"]]], ["Survivor: Outwit, Outplay, Outlast", [["country", "US"], ["attr", "Full Title"]]], ["Survivor: Palau", [["country", "US"], ["attr", "10th season title"]]], ["Survivor: Panama - Exile Island", [["country", "US"], ["attr", "12th season title"]]], ["Survivor: Pearl Islands", [["country", "US"], ["attr", "7th season title"]]], ["Survivor: Philippines", [["country", "US"], ["attr", "25th season title"]]], ["Survivor: Redemption Island", [["country", "US"], ["attr", "22nd season title"]]], ["Survivor: Samoa", [["country", "US"], ["attr", "19th season title"]]], ["Survivor: Samoa II", [["country", "US"], ["attr", "20th season Alternate title"]]], ["Survivor: South Pacific", [["country", "US"], ["attr", "23rd season title"]]], ["Survivor: Thailand", [["country", "US"], ["attr", "5th season title"]]], ["Survivor: The Amazon", [["country", "US"], ["attr", "6th season title"]]], ["Survivor: The Australian Outback", [["country", "US"], ["attr", "2nd season title"]]], ["Survivor: Tocantins", [["country", "US"], ["attr", "18th season title"]]], ["Survivor: Vanuatu - Islands of Fire", [["country", "US"], ["attr", "9th season title"]]]]}', 'Survivor', '2012-01-10 19:24:32', '2012-07-12 04:00:19', '20:00', 'GMT-5 +DST', 3600, 'Returning Series', 'CBS', 'US', 'The rules of this game are simple: average Americans are abandoned in the middle of some of the most unforgiving places on earth. Divided into teams, they particiapte in challenges and every three days, the losing tribe must trek to Tribal Council to vote out one of their own. Halfway through the game, the game shifts to individual competitions when the tribes merge and become one, making the game every man for himself.\r\n\r\nThe game is simple: Outwit, Outplay, Outlast, by winning Immunity, thus not being eligible to have votes cast against yourself. However, the players must be careful about who they send packing - after the merge, a jury of seven begins to form, and each week they return to watch the Tribal Council ceremony. At the end of the game, they vote for one of the members of the final two to win One Million Dollars. Who will become the next Survivor?\r\n\r\nGenerally, each season begins with a twist - something different to surprise the new castaways. Survivor is a game of adaptation, and the final two of each season, listed below, were the players most able to adapt to their surroundings and to the people they are playing with. Survivor focuses on the people, and the social commentary that surrounds them. How can these players Outwit, Outplay, and Outlast is the question that the game revolves around.', 0, 0, 0),
