(290, 'Eureka', 7506, 58448, '{"genres": ["Action", "Adventure", "Drama", "Family", "Fantasy", "Sci-Fi"], "classification": "Scripted", "started": "Jul/18/2006", "airday": "Monday", "ended": "Jul/16/2012", "tvrage_link": "http://tvrage.com/Eureka", "seasons": null, "akas": [["A Town Called Eureka", [["country", "UK"]]], ["EUReKA - Die geheime Stadt", [["country", "DE"]]], ["Heur\\u00e9ka - m\\u011bsto div\\u016f", [["country", "CZ"]]], ["\\u05d0\\u05d9\\u05d5\\u05e8\\u05d9\\u05e7\\u05d4", [["country", "IL"]]]]}', 'Eureka', '2012-01-10 19:24:32', '2012-07-18 04:00:26', '21:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'Syfy', 'US', 'The sleepy Pacific Northwest town of Eureka is hiding a mysterious secret. The government has been relocating the world’s geniuses and their families to this rustic town for years where innovation and chaos have lived hand in hand. U.S. Marshall Jack Carter stumbles upon this odd town after wrecking his car and becoming stranded there. When the denizens of the town unleash an unknown scientific creation, Carter jumps in to try to restore order and consequently learns of one of the country’s best kept secrets.', 0, 0, 1),
