(414, 'Dirty Jobs', 6920, 39657, '{"genres": ["Discovery/Science"], "classification": "Reality", "started": "Jul/26/2005", "ended": "", "tvrage_link": "http://tvrage.com/Dirty_Jobs", "seasons": null, "airday": "Wednesday"}', 'DirtyJobs', '2008-01-07 08:59:36', '2012-08-18 04:00:26', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'Discovery Channel', 'US', 'Each week, our brave host and apprentice Mike Rowe introduces viewers to a hardworking group of men and women who overcome fear, danger and sometimes stench to accomplish their daily tasks. With his hands-on approach, Rowe assumes the duties of the jobs in question working alongside rattlesnake catchers, fish processors, bee removers and other professionals performing the vital yet outlandish occupations that simply must get done. A tremendously good sport, Rowe knows that whether it’s serving greasy slop to pigs in Iowa, or picking up five-day-old road kill and transporting it to a crematorium, it’s all part of an honest day’s work.', 0, 0, 0),
