(513, 'Psychoville', 22870, 77352, '{"genres": ["Comedy"], "classification": "Scripted", "started": "Jun/18/2009", "ended": "", "tvrage_link": "http://tvrage.com/Psychoville", "seasons": null, "airday": "Thursday"}', 'Psychoville', '2009-07-22 01:15:21', '2012-03-26 03:00:23', '22:00', 'GMT+0 +DST', 1800, 'Canceled/Ended', 'BBC TWO', 'UK', 'After creating the kind of northern town nightmares are made of, The League Of Gentlemen''s Reece Shearsmith and Steve Pemberton are looking for a new place to settle down... welcome to Psychoville.\r\n\r\nWritten by the Leagsters for BBC Two, Psychoville is a dark character comedy mystery featuring characters from all over the UK, who each receive a mysterious letter.\r\n\r\nThey include a blind man with a curious collection, a midwife with a very odd child, a dwarf who''s in love with his panto Snow White and a one-handed clown and children''s entertainer with a hook.\r\n\r\nYet despite having different backgrounds, different interests, and coming from different parts of the country, every one has been sent an anonymous, black-edged card which reads: "I know what you did…"', 0, 0, 1),
(514, 'Hell''s Kitchen (US)', 3828, 29085, '{"genres": ["Cooking/Food", "Talent"], "classification": "Reality", "started": "May/30/2005", "airday": "Monday", "ended": "", "tvrage_link": "http://tvrage.com/Hells_Kitchen_US", "seasons": null, "akas": [["Oorlog in de keuken", [["country", "NL"]]]]}', 'HellsKitchen', '2009-07-22 01:18:51', '2012-07-26 04:00:26', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'FOX', 'US', 'Chef Gordon Ramsay is a former soccer player who is much better known for his top star ratings worldwide as a chef. \r\n\r\nHaving a highly successful show in the UK, Fox brought him to their network with 12 hopeful apprentices vying to win a new restaurant of their own. If it were just about their cooking talents, it might be easy, but this isn’t called “hell’s kitchen” without the devil himself, Ramsay, making incredible demands for perfection -  something he himself provides as is proven by his many years of winning top worldwide awards for his magnificent cuisine and presentation. \r\n\r\nIf you can stand the heat, welcome to Hell’s Kitchen. ', 0, 0, 0),
