(516, 'Make It or Break It', 22679, 77036, '{"genres": ["Drama", "Family", "Sports"], "classification": "Scripted", "started": "Jun/22/2009", "airday": "Monday", "ended": "May/14/2012", "tvrage_link": "http://tvrage.com/Make_It_or_Break_It", "seasons": null, "akas": [["Championnes \\u00e0 tout prix", [["country", "FR"]]], ["Perfect 10", [["attr", "working title"]]]]}', 'MakeItorBreakIt', '2009-07-22 01:24:28', '2012-05-18 04:00:39', '21:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'ABC Family', 'US', 'Set in the world of competitive gymnastics, "Make It or Break It"  follows a group of teen Olympic hopefuls as they train and prepare for their day in the spotlight.\r\n\r\nThe cast includes Chelsea Hobbs as gymnastic newcomer ''Emily Kmetko'', Ayla Kell as top gymnast ''Payson Keeler'', Josie Loren as the beautiful gymnast ''Kaylie Cruz'', and Zachary Burr Abel as the gym''s resident hottie, ''Carter Anderson.'' Peri Gilpin and Candace Cameron Bure both make a return to series television in starring roles.', 0, 0, 1),
(518, 'Wipeout', 18959, 75217, '{"genres": ["Comedy"], "classification": "Game Show", "started": "Jun/24/2008", "airday": "Thursday", "ended": "", "tvrage_link": "http://tvrage.com/Wipeout", "seasons": null, "akas": [["Joki\\u0173 kli\\u016b\\u010di\\u0173!", [["country", "LT"]]], ["Total Wipeout USA", [["country", "UK"]]], ["Winter Wipeout", [["country", "US"], ["attr", "Fourth Season Title"]]], ["Wipeout USA", [["country", "NO"]]]]}', 'Wipeout', '2009-08-07 23:07:44', '2012-08-27 04:00:34', '20:00', 'GMT-5 +DST', 3600, 'Returning Series', 'ABC', 'US', 'Hosted by the two Johns (Anderson and Henson), Wipeout takes twenty-four contestants through a grueling qualifying course, before they are whittled down to 12 and compete in various obstacle courses filled with crashes and "wipeouts." Each episode, one final competitor is crowned Wipeout Champion and rewarded $50,000. ', 0, 0, 0),
(520, 'NCIS: Los Angeles', 21934, 76607, '{"genres": ["Action", "Crime", "Drama", "Family", "Military/War", "Mystery", "Thriller"], "classification": "Scripted", "started": "Sep/22/2009", "airday": "Tuesday", "ended": "", "tvrage_link": "http://tvrage.com/NCIS_Los_Angeles", "seasons": null, "akas": [["Agenci NCIS: Los Angeles", [["country", "PL"]]], ["Navy CIS: L.A", [["country", "DE"], ["attr", "Alternate title"]]], ["NCIS Legend", [["country", "US"], ["attr", "Working title"]]], ["NCIS Los Angeles", [["country", "FI"], ["attr", "Alternate title"]]], ["NCIS Office of Special Projects", [["country", "US"], ["attr", "Working title"]]], ["NCIS Undercover", [["country", "US"], ["attr", "Working title"]]], ["NCIS: LA", [["country", "US"], ["attr", "Short title"]]], ["NCIS: Los \\u00c1ngeles", [["country", "ES"], ["attr", "Alternate title"]]], ["Untitled NCIS Spinoff", [["country", "US"], ["attr", "Working title"]]]]}', 'NCISLosAngeles', '2009-08-11 16:03:46', '2012-03-14 04:00:27', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'CBS', 'US', 'NCIS: Los Angeles is a drama about the high stakes world of undercover surveillance at the Office of Special Projects (OSP), a division of NCIS that is charged with apprehending dangerous and elusive criminals that pose a threat to the nation''s security. By assuming false identities and utilizing the most advanced technology, this team of highly trained agents goes deep undercover, putting their lives on the line in the field to bring down their targets.', 0, 0, 0),
(521, 'White Collar', 20720, 75381, '{"genres": ["Drama"], "classification": "Scripted", "started": "Oct/23/2009", "airday": "Tuesday", "ended": "", "tvrage_link": "http://tvrage.com/White_Collar", "seasons": null, "akas": [["FBI : duo tr\\u00e8s sp\\u00e9cial", [["country", "FR"]]], ["\\u0411\\u0435\\u043b\\u044b\\u0439 \\u0432\\u043e\\u0440\\u043e\\u0442\\u043d\\u0438\\u0447\\u043e\\u043a", [["country", "RU"]]]]}', 'WhiteCollar', '2009-08-21 12:37:59', '2012-06-01 04:00:29', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'USA', 'US', 'White Collar is about the unlikely partnership of a con artist and an FBI agent who have been playing cat and mouse for years. \r\n\r\nNeal Caffrey, an incredibly charming criminal mastermind, is finally caught by his nemesis, G-Man extraordinaire Peter Stokes. When Neal escapes from a maximum-security prison to find his long-lost love, Peter nabs him once again. \r\n\r\nRather than returning to jail for his daring getaway, Neal suggests an alternate plan: he''ll provide his cunning criminal expertise to assist the Feds in catching other notorious and elusive criminals. \r\n\r\nInitially wary, Peter quickly finds that Neal provides insight and intuition that cannot be found on the right side of the law.\r\n', 0, 0, 0),
(522, 'The Good Wife', 22755, 76761, '{"genres": ["Drama", "Family"], "classification": "Scripted", "started": "Sep/22/2009", "ended": "", "tvrage_link": "http://tvrage.com/The_Good_Wife", "seasons": null, "airday": "Sunday"}', 'GoodWife', '2009-08-21 12:41:13', '2012-03-14 04:00:28', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'CBS', 'US', 'The Good Wife is a female-driven drama about a politician''s wife who pursues her own career as a defense attorney after her husband is sent to jail on charges of political corruption. \r\n\r\nAlicia Florrick will not only have to deal with her career but also with keeping her family together by providing a stable home for her two children.', 0, 0, 0),
(523, 'Being Erica', 20818, 76395, '{"genres": ["Comedy", "Drama", "Fantasy"], "classification": "Scripted", "started": "Jan/05/2009", "airday": "Monday", "ended": "Dec/12/2011", "tvrage_link": "http://tvrage.com/Being_Erica", "seasons": null, "akas": [["By\\u0107 jak Erica", [["country", "PL"]]], ["Erica", [["country", "MX"]]], ["Erica vil\\u00e1ga", [["country", "HU"]]], ["Les vies r\\u00eav\\u00e9es d''Erica Strange", [["country", "FR"]]]]}', 'BeingErica', '2009-08-21 12:44:01', '2012-07-31 04:00:33', '21:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'CBC', 'CA', 'Thirty-something Erica Strange receives the ultimate opportunity - to go back in time and relive her most defining moments. From first kisses and prom nights to job interviews, Erica now has the chance to put right her long list of regrets with the hope that it will result in the life she really wants. ', 0, 0, 1),
(526, 'The Universe', 16083, 73410, '{"genres": ["Family"], "classification": "Documentary", "started": "May/29/2007", "ended": "", "tvrage_link": "http://tvrage.com/The_Universe", "seasons": null, "airday": "Tuesday"}', 'Universe', '2009-09-05 04:36:42', '2012-03-16 04:00:20', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'H2 TV', 'US', 'From the planets to the stars and out to the edge of the unknown, history and science collide in this epic exploration of the Universe and its mysteries. It''s a very old universe. Yet just 50 years since man first ventured into outer space, the heavens are yielding their greatest secrets. \r\n\r\nRobotic rovers give us eyes on the red rock of Mars--NASA probes slam into comets at hyper speed--deep-space telescopes capture violent images of the birth of stars and their collapse into black holes. All have significantly changed the way we see ourselves. \r\n\r\nWe wonder, is there anywhere else out there that that can support life? Using cutting-edge computer graphics, this series brings the universe down to earth to show what life would be like on other planets, and to imagine what kind of life forms might evolve in alien atmospheres. \r\n\r\nEpisodes examine how discoveries were made and the scientists and explorers who dared to venture into the uncharted territory of the universe.', 0, 0, 0),
(528, 'Glee', 21704, 75988, '{"genres": ["Comedy", "Music"], "classification": "Scripted", "started": "May/19/2009", "airday": "Thursday", "ended": "", "tvrage_link": "http://tvrage.com/Glee", "seasons": null, "akas": [["Losers", [["country", "RU"]]]]}', 'Glee', '2009-09-05 04:42:05', '2012-05-24 04:00:26', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'FOX', 'US', 'Glee follows an optimistic high school teacher as he tries to transform the school''s once top-flight, but now moribund Glee Club and inspire a group of talented but unfocused performers to make it to, and win, the biggest competition of them all: Nationals. \r\n\r\nIn his way is not just the indifferent principal, but also the sponsors of the cheerleading and football groups, both of whom see his efforts as detracting from their own. \r\n\r\nHis wife, whose acquisitiveness is out of control, wants him to ignore his love of teaching and quit to become an accountant, so they''ll have more money for her to spend. ', 0, 0, 0),
(530, 'Drop Dead Diva', 21886, 75516, '{"genres": ["Comedy", "Drama"], "classification": "Scripted", "started": "Jul/12/2009", "ended": "", "tvrage_link": "http://tvrage.com/Drop_Dead_Diva", "seasons": null, "airday": "Sunday"}', 'DropDeadDiva', '2009-09-06 21:58:46', '2012-03-14 04:00:28', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'Lifetime', 'US', 'Drop Dead Diva is a spirited new comedic drama series that puts a uniquely compelling twist on the age-old battle between brains and beauty.\r\n\r\nThe show tells the story of a shallow model-in-training who dies in a sudden accident only to find her soul resurfacing in the body of a brilliant, thoughtful and plus-size attorney.', 0, 0, 0),
