(532, 'The Fixer', 18497, 75455, '{"genres": ["Action", "Crime", "Drama"], "classification": "Scripted", "started": "Mar/10/2008", "ended": "Oct/06/2009", "tvrage_link": "http://tvrage.com/The_Fixer", "seasons": null, "airday": "Tuesday"}', 'Fixer', '2009-09-10 12:57:22', '2012-03-26 03:00:24', '21:00', 'GMT+0 +DST', 3600, 'Canceled/Ended', 'ITV1', 'UK', 'John Mercer is a former member of the Special Forces serving a double life sentence. He is released from prison unexpectedly early and introduced to the shadowy Lenny Douglas, a police officer retired on grounds of ill health.\r\n\r\nMercer realises his newfound freedom comes at a price. Douglas pulls together an unofficial operation with a single brief -- to remove untouchable criminals from society.\r\n\r\nMercer must use the skills he learned in the Special Forces to execute a series of discreet hits.\r\n\r\nTo help him complete each mission, Mercer is introduced to his new colleagues who include Calum McKenzie, a petty thief whose main interests are girls, drugs and music.\r\n\r\nThings are complicated by the final member of Douglas''s group -- the sharp tongued but seductive Rose, an ex-copper forced out of the police by scandal, she has always used her sexuality as her primary weapon and is more than a match for Mercer.', 0, 0, 1),
