(557, 'The Penguins of Madagascar', 21572, 74948, '{"genres": ["Animation General"], "classification": "Animation", "started": "Nov/28/2008", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/The_Penguins_of_Madagascar", "seasons": null, "akas": [["De Pinguins Van Madagascar", [["country", "NL"]]], ["Die Pinguine aus Madagascar", [["country", "DE"]]]]}', 'PenguinsofMadagascar', '2009-12-01 02:45:04', '2012-05-14 03:01:36', '10:00', 'GMT-5 +DST', 1800, 'Returning Series', 'Nickelodeon', 'US', 'To most people, Skipper, Kowalski, Rico and Private are just four cute penguins living in the Central Park Zoo. And that’s exactly what they want people to think. Why? Because these placid-looking penguins are actually an elite strike force with unmatched commando skills and a secret headquarters. Their mission? To maintain order in the zoo. Their nemesis? Their obnoxious new neighbor, King Julien. This party animal and self proclaimed "King of the Lemurs" is new to the zoo...and he''s looking to shake things up.\r\n', 0, 0, 0),
(558, 'Southland', 21197, 75824, '{"genres": ["Crime", "Drama"], "classification": "Scripted", "started": "Apr/09/2009", "airday": "Tuesday", "ended": "", "tvrage_link": "http://tvrage.com/Southland", "seasons": null, "akas": [["LAPD", [["attr", "working title"]]]]}', 'Southland', '2009-12-01 02:45:04', '2012-03-14 04:00:29', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'TNT', 'US', 'From Emmy Award winners John Wells, Ann Biderman and Chris Chulack comes a raw and authentic look at the police unit in Los Angeles. From the beaches of Malibu to the streets of East Los Angeles, "Southland" is a fast-moving drama that will take viewers inside the lives of cops, criminals, victims and their families.\r\nMichael Cudlitz ("A River Runs Through It") plays John Cooper a seasoned Los Angeles cop assigned to train young rookie Ben Sherman (Benjamin McKenzie, "The O.C."). Cooper''s honest, no-nonsense approach to the job leaves Sherman questioning whether or not he has what it takes to become a police officer.\r\nCudlitz and McKenzie are joined by other cast members including Regina King ("Ray," "Jerry Maguire") who plays Detective Lydia Adams. Adams lives with and is the primary caregiver of her mother. Her partner, Detective Russell Clarke (Tom Everett Scott, "Boiler Room") is an unhappily married father of three. Michael McGrady ("The Thin Red Line") plays Detective Daniel "Sal" Salinger. Sal oversees fellow gang detectives Nate Moretta (Kevin Alejandro, "Drive," "Ugly Betty") and Sammy Bryant (Shawn Hatosy, "Alpha Dog"). Arija Bareikis ("Crossing Jordan") plays as patrol officer Chickie Brown, a single mom who dreams of being the first woman accepted into SWAT.', 0, 0, 0),
(560, 'The League', 24173, 77568, '{"genres": ["Comedy"], "classification": "Scripted", "started": "Oct/29/2009", "ended": "", "tvrage_link": "http://tvrage.com/The_League", "seasons": null, "airday": "Thursday"}', 'League', '2009-12-01 02:45:04', '2012-03-14 04:00:29', '22:30', 'GMT-5 +DST', 1800, 'Returning Series', 'FX', 'US', 'An ensemble cast comedy revolving around a fantasy football league provides an entertaining look at friendship, marriage, parenting, and growing up...or refusing to grow up.\r\n\r\nAt the end there is a question, I''ve got a show that''s not on TV but in the Internet named Riese. But I found it on TV.COM. Is there a chance you can add it, if not that''s of course not a problem.\r\n', 0, 0, 0),
(569, 'Jersey Shore', 24425, 78312, '{"genres": [null, "Action", "Adult/Porn", "Adventure", "Anthology", "Arts & Crafts", "Automobiles", "Buy, Sell & Trade", "Celebrities", "Children", "Cinema/Theatre", "Comedy", "Cooking/Food", "Crime", "Current Events", "Dance", "Debate", "Design/Decorating", "Discovery/Science", "Drama", "Educational"], "classification": "Reality", "started": "Dec/03/2009", "ended": "", "tvrage_link": "http://tvrage.com/Jersey_Shore", "seasons": null, "airday": "Thursday"}', 'JerseyShore', '2009-12-11 01:41:06', '2012-09-01 04:00:44', '22:00', 'GMT-5 +DST', 3600, 'Final Season', 'MTV', 'US', 'Grab your hair gel, wax that Cadillac and get those tattooed biceps ready to fist pump with the best this summer at the Jersey Shore. \r\n\r\nMTV''s newest docu-soap exposes one of the tri-state area''s most misunderstood species, the Guido. Our Guidos and Guidettes will move into the ultimate beach house rental and indulge in everything the Seaside Heights, New Jersey scene has to offer. Beach by day, dancing and partying all night. They''ll live, work, and rage together until the summer ends. There''s no spray tan too orange, no hair too spiked, and no bod too tight for this crew.\r\n', 0, 0, 0),
(571, 'Wallander', 18175, 76439, '{"genres": ["Crime", "Drama"], "classification": "Scripted", "started": "Nov/30/2008", "ended": "", "tvrage_link": "http://tvrage.com/Wallander", "seasons": null, "airday": "Sunday"}', 'Wallander', '2010-01-09 16:27:16', '2012-03-26 03:00:25', '21:00', 'GMT+0 +DST', 5400, 'Returning Series', 'BBC One', 'UK', 'This drama follows Inspector Kurt Wallander – a middle-aged everyman – as he struggles against a rising tide of violence in the apparently sleepy backwaters in and around Ystad in Skane, southern Sweden. \r\n\r\nBased on the international best-selling books by Henning Mankell.', 0, 0, 0),
(574, 'Man vs. Wild', 14573, 66696, '{"genres": ["Adventure", "Thriller"], "classification": "Reality", "started": "Nov/10/2006", "airday": "Friday", "ended": "", "tvrage_link": "http://tvrage.com/Man_vs_Wild", "seasons": null, "akas": [["Abenteuer Survival", [["country", "DE"]]], ["Bear Grylls - Born Survivor", [["country", "UK"], ["attr", "UK Title"]]], ["Tehnici esen\\u0163iale de supravie\\u0163uire", [["country", "RO"]]]]}', 'ManVsWild', '2010-01-14 15:35:47', '2012-03-15 04:00:21', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'Discovery Channel', 'US', 'Bear Grylls travels around the globe to find the most dangerous tourist locations and environments, in order to show us how to survive in them. With his simple survival techniques and his knowledge of the wildlife, he is able to give handy tips that could effectively save lives.\r\nWhether it''s traversing across volcanos or stuck on a desert island, Bear is always one step ahead when it comes to survival of the fittest. ', 0, 0, 0),
