(581, 'Law & Order: UK', 18198, 75193, '{"genres": ["Action", "Crime", "Drama"], "classification": "Scripted", "started": "Feb/23/2009", "airday": "Friday", "ended": "", "tvrage_link": "http://tvrage.com/Law_And_Order-UK", "seasons": null, "akas": [["Den h\\u00e5rda lagen: London", [["country", "FI"], ["attr", "Swedish title"]]], ["Kova laki: Lontoo", [["country", "FI"]]], ["Law & Order: London", [["country", "IE"]]], ["Londres, Police Judiciaire", [["country", "FR"]]]]}', 'LawandOrderUK', '2010-02-06 11:36:38', '2012-03-26 03:00:26', '21:00', 'GMT+0 +DST', 3600, 'Returning Series', 'ITV1', 'UK', 'The longest-running crime series in U.S. television history has made its way across the pond for a UK reworking. Series creator Dick Wolf has given Law & Order a makeover-for fans in the UK. \r\n\r\nLaw & Order: UK sets out to retain the grittiness of the original series, but be uniquely British.', 0, 0, 0),
