(586, 'Parenthood ', 22586, 76680, '{"genres": ["Comedy", "Drama", "Family"], "classification": "Scripted", "started": "Mar/02/2010", "ended": "", "tvrage_link": "http://tvrage.com/Parenthood_2010", "seasons": null, "airday": "Tuesday"}', 'Parenthood_2009', '2010-03-03 13:46:38', '2012-03-14 04:00:30', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'NBC', 'US', 'Based on the 1989 film of the same name, ''Parenthood'' is an hour long comedy-drama produced by Jason Katims and Ron Howard. The show will address the modern challenges of raising kids in this post-technological world, addressing issues that effect both kids and parents. ', 0, 0, 0);
