(587, 'Dan for Mayor', 25240, 78778, '{"genres": ["Comedy"], "classification": "Scripted", "started": "Mar/01/2010", "ended": "Aug/28/2011", "tvrage_link": "http://tvrage.com/Dan_for_Mayor", "seasons": null, "airday": null}', 'DanForMayor', '2010-03-03 13:49:37', '2012-03-14 04:00:30', '20:30', 'GMT-5 +DST', 1800, 'Canceled/Ended', 'CTV', 'CA', 'The series stars Fred Ewanuick as the titular Dan, a slacker in his early 30s who, after finding out that his ex-girlfriend is engaged, finds himself running for mayor for his home town by a chance comment.\r\nAfter hearing that his ex-girlfriend is now engaged to another man, Dan tries to impress her by saying that he''s running for mayor. Stuck with his lie, he now has to start a campaign. \r\n\r\nWhen his opponent is hit by a bus and killed, Dan knows that he will win the election. Unfortunately, he''s new to the politics business, and has a lot to learn. The cast also includes Mary Ashton, Paul Bates and Benjamin Ayres.', 0, 0, 1),
(588, 'Hiccups', 23201, 78777, '{"genres": ["Comedy", "Family"], "classification": "Scripted", "started": "Mar/01/2010", "ended": "Aug/28/2011", "tvrage_link": "http://tvrage.com/shows/id-23201", "seasons": null, "airday": "Monday"}', 'Hiccups', '2010-03-03 13:49:37', '2012-03-14 04:00:30', '20:00', 'GMT-5 +DST', 1800, 'Canceled/Ended', 'CTV', 'CA', 'This show features Roberson as Millie Upton, a childrens author with issues. She experiences a lot of emotion and with the help of her friends, she tries to keep in check and overcome these emotional hiccups and keep them out of the public eye.\r\nAfter suffering an emotional outburst in a coffee shop, Millie''s publisher threatens to cancel her future public speaking events unless and until she gets help. This leads Millie to Stan, a well-meaning although not particularly experienced life coach, who tries to help her get control of her emotions.\r\n', 0, 0, 1),
(589, 'Justified', 23472, 77651, '{"genres": ["Drama"], "classification": "Scripted", "started": "Mar/16/2010", "airday": "Tuesday", "ended": "", "tvrage_link": "http://tvrage.com/Justified", "seasons": null, "akas": [["Lawman", [["attr", "Working Title"]]]]}', 'Justified', '2010-03-05 17:26:35', '2012-03-15 04:00:21', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'FX', 'US', 'This show is about U.S. Marshal Raylan Givens, a modern day 19th century-style lawman, who enforces his brand of justice to put a target on his back with criminals and puts him at odds with his bosses in the Marshal service. As a result, he gets reassigned to the U.S. District covering the town where he grew up.', 0, 0, 0),
(592, 'Treme', 22606, 75910, '{"genres": ["Drama"], "classification": "Scripted", "started": "Apr/11/2010", "ended": "", "tvrage_link": "http://tvrage.com/Treme", "seasons": null, "airday": "Sunday"}', 'Treme', '2010-04-13 20:37:49', '2012-03-14 04:00:30', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'HBO', 'US', 'Follow the lives of survivors of Katrina in New Orleans and how they are making their way through life trying to rebuild the city.', 0, 0, 0),
(594, 'Waterloo Road', 8531, 61749, '{"genres": ["Drama"], "classification": "Scripted", "started": "Mar/09/2006", "ended": "", "tvrage_link": "http://tvrage.com/Waterloo_Road", "seasons": null, "airday": "Wednesday"}', 'WaterlooRoad', '2010-04-22 19:03:35', '2012-03-26 03:00:26', '20:00', 'GMT+0 +DST', 3600, 'Returning Series', 'BBC One', 'UK', 'Waterloo Road Comprehensive is on the scrap heap. It can be found very near the bottom of every league table there is. Its despondent teachers have given up trying to make a difference as they struggle to cope with their own personal problems as well as their nightmare day jobs. When the current Headmaster has a nervous breakdown, Jack Rimmer is reluctantly thrown into the hot seat. He recruits optimistic, educational zealot Andrew Treneman who wants to give up his comfortable private school job to bring the benefits of his elite educational experience to Waterloo Road.\r\nTogether with feisty Guidance Head Kim Campbell the three teachers - all committed in their very different ways - set to turn round Waterloo Road, painful step by painful step. Meanwhile English teacher Tom Clarkson''s life is in a mess. He''s about to be married to live-in girlfriend and fellow teacher Lorna Dickey and can''t face telling her he is no longer in love. But much worse, he has fallen for Lorna''s closest friend - drama teacher Izzie Redpath.\r\nMan-eating French teacher Steph Haydock is delighted Jack Rimmer has been promoted - she''s always fancied him but now he''s headmaster, his powerful, manly charms are impossible to resist. ', 0, 0, 0),
(596, 'The Life and Times of Tim', 18401, 68699, '{"genres": ["Adult Cartoons"], "classification": "Animation", "started": "Sep/28/2008", "ended": "", "tvrage_link": "http://tvrage.com/The_Life_and_Times_of_Tim", "seasons": null, "airday": "Friday"}', 'LifeandTimesofTim', '2010-05-02 11:03:16', '2012-05-29 04:00:48', '21:00', 'GMT-5 +DST', 1800, 'Canceled/Ended', 'HBO', 'US', 'This animated comedy brings viewers into the fascinating life of a twenty-something guy.', 0, 0, 1),
(598, 'Mock The Week', 7081, 67864, '{"genres": ["Comedy", "Sketch/Improv"], "classification": "Variety", "started": "Oct/2005", "ended": "", "tvrage_link": "http://tvrage.com/Mock_The_Week", "seasons": null, "airday": "Thursday"}', 'MocktheWeek', '2010-05-02 11:05:39', '2012-03-26 03:00:26', '21:00', 'GMT+0 +DST', 1800, 'Returning Series', 'BBC TWO', 'UK', 'Mock the Week is a political comedy improv show from the producers of Whose Line Is It Anyway? The series features teams of comedians improvising sketches about current political events in a humorous and ofter satirical manner. Mock the Week stars Dara O Briain and features Frankie Boyle, Hugh Dennis, Andy Parsons and Russell Howard with a different set of celebrity comic guests each week making up the other team.', 0, 0, 0),
(603, 'Futurama', 3628, 249, '{"genres": ["Adult Cartoons", "Comedy", "Sci-Fi"], "classification": "Animation", "started": "Mar/28/1999", "ended": "", "tvrage_link": "http://tvrage.com/Futurama", "seasons": null, "airday": "Wednesday"}', 'Futurama', '2010-06-02 18:59:45', '2012-07-19 04:00:32', '22:00', 'GMT-5 +DST', 1800, 'Returning Series', 'Comedy Central', 'US', 'When Fry, a somewhat dim-witted 25 year-old pizza delivery boy for Panucci''s Pizza is asked to make a drop at Applied Cryogenics, it''s the beginning of a journey that will take him more than a thousand years into the future.\r\n\r\nFry falls into one of the company''s capsules and doesn''t emerge until the dawn of the year 3000. Here he befriends a beautiful one-eyed alien called Leela (a worker at the New York based cryogenics factory) and a degenerate robot named Bender. The trio track down Fry''s great-great-great-etc. nephew, Professor Farnsworth, who hires the three to work for his intergalactic delivery service. Together they traverse the cosmos delivering goods for Planet Express, Leela serves as the ship''s captain and Bender indulges in his love of booze, large cigars and pornography. \r\n\r\nIt was recently announced that Futurama will be returning with 26 new episodes in 2010 on Comedy Central. The cable net has already re-signed voice stars Billy West, Katey Sagal and John DiMaggio to reprise their animated roles. ', 0, 0, 0),
(607, 'Pretty Little Liars', 25591, 78650, '{"genres": ["Drama", "Mystery", "Teens"], "classification": "Scripted", "started": "Jun/08/2010", "airday": "Tuesday", "ended": "", "tvrage_link": "http://tvrage.com/Pretty_Little_Liars", "seasons": null, "akas": [["\\u041c\\u0438\\u043b\\u044b\\u0435 \\u043e\\u0431\\u043c\\u0430\\u043d\\u0449\\u0438\\u0446\\u044b", [["country", "RU"]]]]}', 'PrettyLittleLiars', '2010-06-15 21:33:45', '2012-05-29 04:00:49', '20:00', 'GMT-5 +DST', 3600, 'Returning Series', 'ABC Family', 'US', 'Never trust a pretty girl with an ugly secret. Gossip thrives amid the Mercedes-Benz, mega mansions, and perfectly manicured hedges in the exclusive town of Rosewood, Pennsylvania. \r\n\r\nEveryone has something to hide. Based off the book series of the same name, the series follows four estranged… More best friends Spencer, Hanna, Aria, and Emily who are reunited after their best friend and queen bee of the group, Alison, goes missing only to discover they are receiving messages from an anonymous "A" who knows all their secrets', 0, 0, 0),
(610, 'Pulse', 25887, 79556, '{"genres": ["Drama", "Medical"], "classification": "Scripted", "started": "Jun/03/2010", "ended": "Jun/03/2010", "tvrage_link": "http://tvrage.com/Pulse_UK", "seasons": null, "airday": "Thursday"}', 'Pulse', '2010-06-15 21:35:14', '2012-03-26 03:00:27', '21:00', 'GMT+0 +DST', 3600, 'Canceled/Ended', 'BBC THREE', 'UK', 'A year after her mother''s death, Hannah resumes her training at one of the country''s top teaching hospitals. She is soon terrified by strange visions and the threatening behaviour of her ex-boyfriend and star surgeon Nick and wonders if she has come back too soon. But beneath the hospital''s reputation of medical excellence she discovers a secret network of dangerous experiments pushing back the boundaries of science. Pulse was written by Paul Cornell from a story by Ben Teasdale. The show was created by Paul Cornell, Ben Teasdale and Tom McRae.', 0, 0, 1),
(612, 'Fifth Gear', 6740, 71360, '{"genres": ["Automobiles"], "classification": "Reality", "started": "Apr/08/2002", "airday": "Friday", "ended": "", "tvrage_link": "http://tvrage.com/shows/id-6740", "seasons": null, "akas": [["5th Gear", [["attr", "Previous title"]]], ["Penktoji pavara", [["country", "LT"]]]]}', 'FifthGear', '2010-06-25 18:19:38', '2012-08-04 04:00:30', '19:30', 'GMT+0 +DST', 3600, 'Returning Series', 'Discovery Channel', 'UK', 'Fifth Gear is a British show and as implied by the title, it''s about cars. The hosts have motorsport backgrounds and take you under the hoods of the latest speedsters and conduct tests and stunts to see what different cars are capable of.', 0, 0, 0),
(616, 'The Glades', 25608, 78739, '{"genres": ["Action", "Crime", "Drama", "Family", "Mystery"], "classification": "Scripted", "started": "Jul/11/2010", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/The_Glades", "seasons": null, "akas": [["Sugarloaf", [["country", "US"], ["attr", "Working title"]]]]}', 'Glades', '2010-06-25 18:21:01', '2012-08-14 04:00:34', '21:00', 'GMT-5 +DST', 3600, 'TBD/On The Bubble', 'A&E', 'US', '', 0, 0, 0),
(619, 'Haven', 24496, 78043, '{"genres": ["Horror/Supernatural", "Mystery"], "classification": "Scripted", "started": "Jul/09/2010", "ended": "", "tvrage_link": "http://tvrage.com/Haven", "seasons": null, "airday": "Friday"}', 'Haven', '2010-07-18 10:24:46', '2012-03-14 04:00:30', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'Syfy', 'US', '', 0, 0, 0),
(620, 'Rookie Blue', 22464, 79199, '{"genres": ["Action", "Crime", "Drama"], "classification": "Scripted", "started": "Jun/24/2010", "airday": "Thursday", "ended": "", "tvrage_link": "http://tvrage.com/Rookie_Blue", "seasons": null, "akas": [["Copper", [["attr", "Working Title"]]], ["Nowe Gliny", [["country", "PL"], ["attr", "13th Street Universal"]]]]}', 'RookieBlue', '2010-07-18 10:24:46', '2012-05-27 04:00:47', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'Global', 'CA', 'The series centers around a group of rookie cops. Rookie Blue is a youthful, heartfelt, one-hour, character-driven workplace drama about five rookie cops plunged into the high stakes world of big city policing - a world where even the smallest mistake can have life-or-death consequences. The series follows them just out of the police academy where they bonded together, fought together, drank together, worked together and slept together. And now they''re on the job together. They''re kids with guns, learning firsthand the hardest kind of policing there is. They are first responders and they are about to learn that no amount of training prepares you for life.', 0, 0, 1),
(625, 'Rizzoli & Isles', 24996, 78590, '{"genres": ["Crime", "Drama"], "classification": "Scripted", "started": "Jul/12/2010", "ended": "", "tvrage_link": "http://tvrage.com/Rizzoli_And_Isles", "seasons": null, "airday": "Tuesday"}', 'RizzoliandIsles', '2010-07-18 10:28:28', '2012-05-29 04:00:49', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'TNT', 'US', '', 0, 0, 0),
(626, 'Rev', 25915, 79557, '{"genres": ["Comedy", "Lifestyle"], "classification": "Scripted", "started": "Jun/28/2010", "ended": "", "tvrage_link": "http://tvrage.com/Rev", "seasons": null, "airday": "Monday"}', 'Rev', '2010-07-18 10:28:28', '2012-03-26 03:00:27', '22:00', 'GMT+0 +DST', 1800, 'New Series', 'BBC TWO', 'UK', 'Anybody can and does come into St Saviour’s – and into Adam’s life. From scheming MPs trying to educate their children on the cheap to Colin, a heavy drinking, unemployable lost soul who is Adam’s most devoted parishioner. Then there’s Mick, the local crackhead in need of £20 to visit his ‘dying mother’ in Southend… She’s died three times in the last 12 months.\r\nEvery day throws up a moral conflict for our vicar. Adam’s door must always be open to urban sophisticates with ulterior motives, the chronically lonely, the lost, the homeless, the poor and the insane. All are welcome at St Saviour’s and Adam can’t turn any of them away. Even if they’re clearly lying, mad or just very annoying.\r\nIn addition to caring for his flock Adam has to worry about the financial burden of running a huge, decaying building – with a smashed stained glass window – and a dwindling congregation. He has to contend with hopeless volunteers, ambitious church rivals, the sinister attentions of the Archdeacon and the romantic attentions of Adoha, a renowned ‘cassock-chaser’ and church regular. Even his supposedly supportive Lay Reader Nigel is a pedantic careerist who thinks he should be running the place himself.', 0, 0, 0),
(632, 'Hot in Cleveland', 24846, 78182, '{"genres": ["Comedy", "Family"], "classification": "Scripted", "started": "Jun/16/2010", "ended": "", "tvrage_link": "http://tvrage.com/Hot_In_Cleveland", "seasons": null, "airday": "Wednesday"}', 'HitinCleveland', '2010-07-18 10:32:45', '2012-03-14 04:00:30', '22:00', 'GMT-5 +DST', 1800, 'Returning Series', 'TV Land', 'US', 'Hot in Clevelan" revolves around three fabulous, eccentric, LA women of a certain age, and best friends whose lives are changed forever when their plane unexpectedly lands in Cleveland and they soon rediscover themselves in this new "promised land."', 0, 0, 0),
(633, 'Memphis Beat', 19699, 79378, '{"genres": ["Crime", "Drama"], "classification": "Scripted", "started": "Jun/22/2010", "airday": "Tuesday", "ended": "", "tvrage_link": "http://tvrage.com/Memphis_Beat", "seasons": null, "akas": [["Delta Blues", [["country", "US"], ["attr", "Working Title"]]]]}', 'MemphisBeat', '2010-07-18 10:32:45', '2012-03-15 04:00:22', '21:00', 'GMT-5 +DST', 3600, 'Canceled/Ended', 'TNT', 'US', '', 0, 0, 1),
