(642, 'Mongrels', 25870, 79632, '{"genres": ["Adult Cartoons", "Pets/Animals"], "classification": "Animation", "started": "Jun/22/2010", "ended": "", "tvrage_link": "http://tvrage.com/Mongrels", "seasons": null, "airday": "Tuesday"}', 'Mongrels', '2010-07-18 10:39:29', '2012-06-10 04:00:26', '22:00', 'GMT+0 +DST', 1800, 'Canceled/Ended', 'BBC THREE', 'UK', '', 0, 0, 1),
(644, 'Boardwalk Empire', 23561, 75748, '{"genres": ["Drama", "Family"], "classification": "Scripted", "started": "Sep/19/2010", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/Boardwalk_Empire", "seasons": null, "akas": [["Boardwalk Empire - Gengszterkorz\\u00f3", [["country", "HU"]]], ["Zakazane imperium", [["country", "PL"]]]]}', 'BoardwalkEmpire', '2012-01-10 19:24:32', '2012-07-29 04:00:31', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'HBO', 'US', '', 0, 0, 0),
(645, 'The Walking Dead', 25056, 78582, '{"genres": ["Action", "Drama", "Family", "Horror/Supernatural", "Thriller"], "classification": "Scripted", "started": "Oct/31/2010", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/The_Walking_Dead", "seasons": null, "akas": [["\\u0416\\u0438\\u0432\\u0438\\u0442\\u0435 \\u043c\\u044a\\u0440\\u0442\\u0432\\u0438", [["country", "BG"]]]]}', 'WalkingDead', '2012-01-10 19:24:32', '2012-03-14 04:00:31', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'AMC', 'US', '', 0, 0, 0),
(646, 'The Big C', 24632, 78474, '{"genres": ["Comedy", "Family"], "classification": "Scripted", "started": "Aug/16/2010", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/The_Big_C", "seasons": null, "akas": [["Krabbinn", [["country", "IS"]]], ["The C Word", [["attr", "Original title"]]]]}', 'BigC', '2012-01-10 19:24:32', '2012-08-02 04:00:32', '21:30', 'GMT-5 +DST', 1800, 'Final Season', 'Showtime', 'US', '', 0, 0, 0),
(650, 'Sherlock', 23433, 79744, '{"genres": ["Crime", "Drama", "Mystery"], "classification": "Scripted", "started": "Jul/25/2010", "airday": "Sunday", "ended": "", "tvrage_link": "http://tvrage.com/Sherlock", "seasons": null, "akas": [["\\u0428\\u0435\\u0440\\u043b\\u043e\\u043a \\u0425\\u043e\\u043b\\u043c\\u0441", [["country", "RU"]]]]}', 'Sherlock', '2012-01-10 19:24:32', '2012-03-26 03:00:27', '20:00', 'GMT+0 +DST', 5400, 'Returning Series', 'BBC One', 'UK', 'Based on the books by Sir Arthur Conan Doyle, this updated version of the Sherlock Holmes stories is modern, edgy, and dangerous. Set in present day London, Holmes is as brilliant and arrogant as ever. His loyal friend Watson served in the Afghanistan war as an army doctor. Together, they embark on thrilling, funny, and outrageous adventures. ', 0, 0, 0),
(653, 'Mike & Molly', 25050, NULL, '{"genres": ["Comedy", "Family"], "classification": "Scripted", "started": "Sep/20/2010", "airday": "Monday", "ended": "", "tvrage_link": "http://tvrage.com/Mike_And_Molly", "seasons": null, "akas": [["Mike and Molly", [["country", "US"], ["attr", "Alternate spelling"]]]]}', 'MikeAndMolly', '2012-01-10 19:24:32', '2012-03-14 04:00:31', '21:30', 'GMT-5 +DST', 1800, 'Returning Series', 'CBS', 'US', '"MIKE & MOLLY" is a comedy from Chuck Lorre ("Two and a Half Men" and "The Big Bang Theory") about a working class Chicago couple who find love at an Overeaters Anonymous meeting. Officer Mike Biggs (Billy Gardell) is a good-hearted cop who sincerely wants to lose weight. Mike''s partner, Officer Carl McMillan (Reno Wilson), is a thin, fast-talking wise-guy, who despite his teasing encourages Mike on his road to slimness and romance. While speaking at an O.A. meeting, Mike meets Molly Flynn (Melissa McCarthy), an instantly likeable fourth-grade teacher with a healthy sense of humor about her curves. For Molly, focusing on smart choices isn''t easy because she lives with her sexy older sister, Victoria (Katy Mixon), and their mother, Joyce (Swoosie Kurtz), both of whom flaunt their healthy appetites and slender figures. Mike also faces temptation at the diner he and Carl frequent, where they''ve become friends with the Senegalese waiter, Samuel (Nyambi Nyambi), who finds trying to eat less a foreign concept. For "Mike and Molly", thanks to their mutual love of pie and the desire to resist it, finding each other may have been worth the "weight."', 0, 0, 0),
(655, 'Hawaii Five-0', 24840, 78112, '{"genres": ["Action", "Crime", "Drama", "Thriller"], "classification": "Scripted", "started": "Sep/20/2010", "airday": "Monday", "ended": "", "tvrage_link": "http://tvrage.com/Hawaii_Five-0", "seasons": null, "akas": [["Havaiji 5-0", [["country", "FI"], ["attr", "Alternate title"]]], ["Havaj 5-0", [["country", "CZ"]]], ["Hawai 5.0", [["country", "ES"], ["attr", "Alternate title"]]], ["Hawaii 5-0", [["country", "FR"], ["attr", "Alternate title"]]], ["\\u0413\\u0430\\u0432\\u0430\\u0439\\u0438 5-0", [["country", "RU"]]]]}', 'hawaiifiveo_2010', '2012-01-10 19:24:32', '2012-08-27 04:00:38', '22:00', 'GMT-5 +DST', 3600, 'Returning Series', 'CBS', 'US', 'HAWAII FIVE-0 is a contemporary take on the classic series about a new elite federalized task force whose mission is to wipe out the crime that washes up on the Islands'' sun-drenched beaches. Detective Steve McGarrett (Alex O''Loughlin), a decorated Naval officer turned cop, returns to Oahu to investigate his father''s murder and stays after Hawaii''s governor persuades him to head up the new team: his rules, her backing, no red tape and full blanket immunity to hunt down the biggest "game" in town. Joining McGarrett is Detective Danny "Danno" Williams (Scott Caan), a newly relocated ex-New Jersey cop who prefers skyscrapers to the coastline but is committed to keeping the Islands safe for his 8-year-old daughter; and Chin Ho Kelly (Daniel Dae Kim), an ex-Honolulu Police Detective wrongly accused of corruption and relegated to a federal security patrol, who is also a former protégé of McGarrett''s father. Chin''s cousin, Kono (Grace Park), is a beautiful and fearless native, fresh out of the academy and eager to establish herself among the department''s elite. McGarrett vows to bring closure to his father''s case while the state''s brash new FIVE-0 unit, who may spar and jest among themselves, is determined to eliminate the seedy elements from the 50th state. Peter Lenkov, Alex Kurtz