(658, 'Lost Girl', 26401, NULL, '{"genres": ["Action", "Adventure", "Drama", "Fantasy", "Horror/Supernatural", "Romance/Dating"], "classification": "Scripted", "started": "Sep/12/2010", "ended": "", "tvrage_link": "http://tvrage.com/Lost_Girl", "seasons": null, "airday": "Sunday"}', 'lostgirl', '2012-01-10 19:24:32', '2012-03-14 04:00:31', '21:00', 'GMT-5 +DST', 3600, 'Returning Series', 'Showcase', 'CA', 'Lost Girl follows supernatural seductress Bo, a Succubus who feeds on the sexual energy of humans. Growing up with human parents, Bo had no reason to believe she was anything other than the girl next door — until she drained her boyfriend to death in their first sexual encounter. Now she has hit the road alone and afraid. ', 0, 0, 0),
(659, 'Melissa & Joey', 25864, 78667, '{"genres": ["Comedy"], "classification": "Scripted", "started": "Aug/17/2010", "ended": "", "tvrage_link": "http://tvrage.com/Melissa_And_Joey", "seasons": null, "airday": "Wednesday"}', 'melissaandjoey', '2012-01-10 19:24:32', '2012-03-14 04:00:31', '20:00', 'GMT-5 +DST', 1800, 'Returning Series', 'ABC Family', 'US', '"Melissa & Joey," a half-hour multi-cam comedy with Melissa Joan Hart and Joey Lawrence executive producing and starring, finds Hart portraying Mel, the grown-up former wild child of a political family who is now a local politician herself. When her sister ends up in prison and brother-in-law flees after a scandal hits, Mel must take responsibility for her teenaged niece Lennox and pre-adolescent nephew Ryder. Spread too thin to manage by herself, help comes in the unlikely form of Joe (Lawrence) who, desperate for a job, moves in and becomes the family''s "manny." David Kendall & Bob Young are executive producers and writers; Paula Hart also serves as executive producer.', 0, 0, 0),
